import React, { useState } from 'react';

import StyleTing from '../UIElements/styleTing';

const Info = props => {
    const [name, setName] = useState('Dan');
    const [age, setAge] = useState('26');
    const [job, setJob] = useState('Coder');
    const [count, setCount] = useState('1')

    return (
            <StyleTing 
                name={name}
                age={age}
                job={job}
                count={count}
                setCount={setCount}
            />
    )
}

export default Info;
